import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <div className="navbar">
      <ul className="side left-side">
        <li>
          <NavLink
            id="news"
            to="/"
            className={({ isActive }) => (isActive ? "active" : undefined)}
            end
          >
            News
          </NavLink>
        </li>
        {!isAuthenticated() && (
          <li>
            <NavLink
              to="/login"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              School
            </NavLink>
          </li>
        )}
        {!isAuthenticated() && (
          <li>
            <NavLink
              to="register"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Work
            </NavLink>
          </li>
        )}
        {!isAuthenticated() && (
          <li>
            <NavLink
              to="contact"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Home
            </NavLink>
          </li>
        )}

        {!isAuthenticated() && (
          <li>
            <NavLink
              to="about"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Study
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="presentation"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Academy
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="activePresentations"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              MarketPlace
            </NavLink>
          </li>
        )}
      </ul>

      <ul className="side right-side">
        {isAuthenticated() && (
          <li>
            <NavLink
              id="contact-sales"
              to="joinALecture"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Contact Sales
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="signOut"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Explore Content
            </NavLink>
          </li>
        )}

        <li>
          <NavLink
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Play
          </NavLink>
        </li>

        <li>
          <NavLink
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Sign Up
          </NavLink>
        </li>

        <li>
          <NavLink
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Log in
          </NavLink>
        </li>
      </ul>
      {isAuthenticated() && (
        <div className="user-greeting">Hello {authUser().firstName}</div>
      )}
    </div>
  );
};

export default NavigationBar;
